import React from 'react'
import { Container } from "@mui/material";

const Purpose = () => {


    return(
        <div style={{backgroundColor:'RED'}}>
            <Container maxWidth='xl' sx={{display:'flex', justifyContent:'center', height:'75vh', backgroundColor:'RED'}}>
                <h1>PURPOSE</h1>
            </Container>
        </div>
    )
}

export default Purpose
